description:
Express, The (2008)  

Verenigde Staten
Drama

geregisseerd door Gary Fleder
met Dennis Quaid, Rob Brown en Charles S. Dutton

Het levensverhaal van football speler Ernie Davis (Rob Brown), die als eerste zwarte speler de Heisman Trophy won. Zijn weg naar de top blijkt vol ongeluk en tegenspoed.


